/* Default */
import React from 'react'

/* Packages */
import { Box, Flex, Track } from 'react-bee'

export const FlexExample = () => (
  <div style={{ background: '#f4f4f4' }}>
    <Box>
      <Track>
        <h2>Flex Example</h2>
      </Track>
      <Flex justifyContent='' flexWrap='wrap'>
        <>
          {Array(10)
            .fill()
            .map((empty, i) => (
              <Track
                key={i}
                background={`#${Math.floor(Math.random() * 16777215).toString(
                  16
                )}`}
                flex='1 1 auto'
                // textAlign='center'
              >
                {i}
              </Track>
            ))}
        </>
      </Flex>
    </Box>
    <br />
  </div>
)
